CREATE FUNCTION public.apurar_frequenciaa(numero character varying, tabela_consulta character varying, tabela_update character varying) RETURNS void
    LANGUAGE plpgsql
    AS $$
declare
	frequencia_num numeric;
	
begin
	select count(resultado) from tabela_consulta
    where resultado like '%'|| numero ||'%'
    into frequencia_num;
	update tabela_update set frequencia=frequencia_num
    where id_num_sort=(numero)::integer;
end;
$$;


